import React, { Component } from "react";
import "../css/header.css";

export class Header extends Component {
  render() {
    return (
      <div className="header">
        <img src="https://geeksjapan.asia/assets/img/logo.png" alt="Logo" />
        <li>Logo</li>
        <li>Logo</li>
      </div>
    );
  }
}

export default Header;
